import axios from "axios"
import { useState, useEffect } from "react"

export default function Home(){
    const [posts,setPosts] = useState("")
    function getPosts(){
        axios({
            method : "GET",
            url : "/api/posts/?format=json"
        }).then((response) => {
            newposts = response.data
            setPosts(newposts)
        })
    }

    useEffect(getPosts, [])

    return(
        <div>posts</div>
    )
}
